        <Card expand="sm" className="que-card">
          <Card.Header>

          </Card.Header>
          <Card.Body>

          </Card.Body>
        </Card>
      </Container>
    )
  }
}

const mapStateToProps = authedUser => {
  console.log('New:: ' + authedUser);
  return {
    authedUser
